package com.idea3d.open_bank_challengue.data

import com.idea3d.open_bank_challengue.core.vo.Resource
import com.idea3d.open_bank_challengue.core.vo.RetrofitClient
import com.idea3d.open_bank_challengue.model.Hero

class DataSource {

    suspend fun getHeroList (heroName:String): Resource<List<Hero>> {
        return Resource.Success(RetrofitClient.webService.GetHeroList(heroName).heroList)
    }

    private val generateHeroList= listOf(
        Hero("Hulk","data:image/jpeg;base64,",""),
        Hero("Flash","data:image/jpeg;base64,",""),
        Hero("Superman","data:image/jpeg;base64,","")
    )

    fun getHeroList():Resource<List<Hero>>{
        return Resource.Success(generateHeroList)
    }
}
